package main
import "fmt"

func winnerOfGame(colors string) bool {
    total_alice, total_bob := 0, 0
    alice, bob := 0, 0
    for _, color := range colors {
        if color == 'A' {
            alice++
            if bob >= 3 {
                total_bob += bob - 2
            }
            bob = 0
        } else {
            bob++
            if alice >= 3 {
                total_alice += alice - 2
            }
            alice = 0
        }
    }
    if alice >= 3 {
        total_alice += alice - 2
    }
    if bob >= 3 {
        total_bob += bob - 2
    }
    return total_alice > total_bob
}

// Main section
func main() {
    for _, colors := range [8]string{
        "AAABABB",
        "AA",
        "ABBBBBBBAAA",
        "",
        "BBABABAABAAAAAABAAABBAABBBABBBABBBABBABABBBBAABAABBBAAAABAAABBABAABBBBBAABBABAAABBAABAAABBABAABBAABA",
        "",
        "",
        "",
    } {
        fmt.Printf("colors = %s\n", colors)
        r := winnerOfGame(colors)
        fmt.Printf("r = %v\n", r)
        fmt.Println("=================")
    }
}

